INSERT INTO `Datasets` VALUES (1,'Affy_U133Plus2','E-MEXP-1243','18596959','Broccoli consumption interacts with GSTM1 to perturb oncogenic signalling pathways in the prostate.','Traka M, Gasper AV, Melchini A, Bacon JR, Needs PW, Frost V, Chantry A, Jones AM, Ortori CA, Barrett DA, Ball RY, Mills RD, Mithen RF','PLoS One','BACKGROUND: Epidemiological studies suggest that people who consume more than one portion of cruciferous vegetables per week are at lower risk of both the incidence of prostate cancer and of developing aggressive prostate cancer but there is little understanding of the underlying mechanisms. In this study, we quantify and interpret changes in global gene expression patterns in the human prostate gland before, during and after a 12 month broccoli-rich diet. METHODS AND FINDINGS: Volunteers were randomly assigned to either a broccoli-rich or a pea-rich diet. After six months there were no differences in gene expression between glutathione S-transferase mu 1 (GSTM1) positive and null individuals on the pea-rich diet but significant differences between GSTM1 genotypes on the broccoli-rich diet, associated with transforming growth factor beta 1 (TGFbeta1) and epidermal growth factor (EGF) signalling pathways. Comparison of biopsies obtained pre and post intervention revealed more changes in gene expression occurred in individuals on a broccoli-rich diet than in those on a pea-rich diet. While there were changes in androgen signalling, regardless of diet, men on the broccoli diet had additional changes to mRNA processing, and TGFbeta1, EGF and insulin signalling. We also provide evidence that sulforaphane (the isothiocyanate derived from 4-methylsuphinylbutyl glucosinolate that accumulates in broccoli) chemically interacts with TGFbeta1, EGF and insulin peptides to form thioureas, and enhances TGFbeta1/Smad-mediated transcription. CONCLUSIONS: These findings suggest that consuming broccoli interacts with GSTM1 genotype to result in complex changes to signalling pathways associated with inflammation and carcinogenesis in the prostate. We propose that these changes may be mediated through the chemical interaction of isothiocyanates with signalling peptides in the plasma. This study provides, for the first time, experimental evidence obtained in humans to support observational studies that diets rich in cruciferous vegetables may reduce the risk of prostate cancer and other chronic disease.','2008-07-02',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(2,'RNA_seq','TCGA','26544944','The Molecular Taxonomy of Primary Prostate Cancer.','Cancer Genome Atlas Research Network.','Cell','There is substantial heterogeneity among primary prostate cancers, evident in the spectrum of molecular abnormalities and its variable clinical course. As part of The Cancer Genome Atlas (TCGA), we present a comprehensive molecular analysis of 333 primary prostate carcinomas. Our results revealed a molecular taxonomy in which 74% of these tumors fell into one of seven subtypes defined by specific gene fusions (ERG, ETV1/4, and FLI1) or mutations (SPOP, FOXA1, and IDH1). Epigenetic profiles showed substantial heterogeneity, including an IDH1 mutant subset with a methylator phenotype. Androgen receptor (AR) activity varied widely and in a subtype-specific manner, with SPOP and FOXA1 mutant tumors having the highest levels of AR-induced transcripts. 25% of the prostate cancers had a presumed actionable lesion in the PI3K or MAPK signaling pathways, and DNA repair genes were inactivated in 19%. Our analysis reveals molecular heterogeneity among primary prostate cancers, as well as potentially actionable molecular defects.','2015-11-05',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Survival analysis,Gene networks'),(3,'Affy_U95 (Av2,B,C)','GSE6919','17430594','Gene expression profiles of prostate cancer reveal involvement of multiple molecular pathways in the metastatic process.','Chandran UR, Ma C, Dhir R, Bisceglia M, Lyons-Weiler M, Liang W, Michalopoulos G, Becich M, Monzon FA','BMC Cancer','BACKGROUND: Prostate cancer is characterized by heterogeneity in the clinical course that often does not correlate with morphologic features of the tumor. Metastasis reflects the most adverse outcome of prostate cancer, and to date there are no reliable morphologic features or serum biomarkers that can reliably predict which patients are at higher risk of developing metastatic disease. Understanding the differences in the biology of metastatic and organ confined primary tumors is essential for developing new prognostic markers and therapeutic targets. METHODS: Using Affymetrix oligonucleotide arrays, we analyzed gene expression profiles of 24 androgen-ablation resistant metastatic samples obtained from 4 patients and a previously published dataset of 64 primary prostate tumor samples. Differential gene expression was analyzed after removing potentially uninformative stromal genes, addressing the differences in cellular content between primary and metastatic tumors. RESULTS: The metastatic samples are highly heterogenous in expression; however, differential expression analysis shows that 415 genes are upregulated and 364 genes are downregulated at least 2 fold in every patient with metastasis. The expression profile of metastatic samples reveals changes in expression of a unique set of genes representing both the androgen ablation related pathways and other metastasis related gene networks such as cell adhesion, bone remodelling and cell cycle. The differentially expressed genes include metabolic enzymes, transcription factors such as Forkhead Box M1 (FoxM1) and cell adhesion molecules such as Osteopontin (SPP1). CONCLUSION: We hypothesize that these genes have a role in the biology of metastatic disease and that they represent potential therapeutic targets for prostate cancer.','2007-04-12',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(4,'RNA_seq','ICGC','23410972','Integrative genomic analyses reveal an androgen-driven somatic alteration landscape in early-onset prostate cancer.','Weischenfeldt J, Simon R, Feuerbach L, Schlangen K, Weichenhan D, Minner S, Wuttig D, Warnatz HJ, Stehr H, Rausch T, Jäger N, Gu L, Bogatyrova O, Stütz AM, Claus R, Eils J, Eils R, Gerhäuser C, Huang PH, Hutter B, Kabbe R, Lawerenz C, Radomski S, Bartholomae CC, Fälth M, Gade S, Schmidt M, Amschler N, Haß T, Galal R, Gjoni J, Kuner R, Baer C, Masser S, von Kalle C, Zichner T, Benes V, Raeder B, Mader M, Amstislavskiy V, Avci M, Lehrach H, Parkhomchuk D, Sultan M, Burkhardt L, Graefen M, Huland H, Kluth M, Krohn A, Sirma H, Stumm L, Steurer S, Grupp K, Sültmann H, Sauter G, Plass C, Brors B, Yaspo ML, Korbel JO, Schlomm T.','Cancer Cell','Early-onset prostate cancer (EO-PCA) represents the earliest clinical manifestation of prostate cancer. To compare the genomic alteration landscapes of EO-PCA with \'classical\' (elderly-onset) PCA, we performed deep sequencing-based genomics analyses in 11 tumors diagnosed at young age, and pursued comparative assessments with seven elderly-onset PCA genomes. Remarkable age-related differences in structural rearrangement (SR) formation became evident, suggesting distinct disease pathomechanisms. Whereas EO-PCAs harbored a prevalence of balanced SRs, with a specific abundance of androgen-regulated ETS gene fusions including TMPRSS2:ERG, elderly-onset PCAs displayed primarily non-androgen-associated SRs. Data from a validation cohort of > 10,000 patients showed age-dependent androgen receptor levels and a prevalence of SRs affecting androgen-regulated genes, further substantiating the activity of a characteristic \'androgen-type\' pathomechanism in EO-PCA.','2013-02-11',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(5,'Affy_HuEx1ST','GSE21034','20579941','Integrative genomic profiling of human prostate cancer.','Taylor BS, Schultz N, Hieronymus H, Gopalan A, Xiao Y, Carver BS, Arora VK, Kaushik P, Cerami E, Reva B, Antipin Y, Mitsiades N, Landers T, Dolgalev I, Major JE, Wilson M, Socci ND, Lash AE, Heguy A, Eastham JA, Scher HI, Reuter VE, Scardino PT, Sander C, Sawyers CL, Gerald WL.','Cancer Cell','Annotation of prostate cancer genomes provides a foundation for discoveries that can impact disease understanding and treatment. Concordant assessment of DNA copy number, mRNA expression, and focused exon resequencing in 218 prostate cancer tumors identified the nuclear receptor coactivator NCOA2 as an oncogene in approximately 11% of tumors. Additionally, the androgen-driven TMPRSS2-ERG fusion was associated with a previously unrecognized, prostate-specific deletion at chromosome 3p14 that implicates FOXP1, RYBP, and SHQ1 as potential cooperative tumor suppressors. DNA copy-number data from primary tumors revealed that copy-number alterations robustly define clusters of low- and high-risk disease beyond that achieved by Gleason score. The genomic and clinical outcome data from these patients are now made available as a public resource.','2010-07-13',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Survival analysis,Gene networks'),(6,'Affy_HuEx1ST','GSE29079','22142399','TMPRSS2-ERG -specific transcriptional modulation is associated with prostate cancer biomarkers and TGF-B signaling.','Brase JC, Johannes M, Mannsperger H, Fälth M, Metzger J, Kacprzyk LA, Andrasiuk T, Gade S, Meister M, Sirma H, Sauter G, Simon R, Schlomm T, Beissbarth T, Korf U, Kuner R, Sültmann H.','BMC Cancer','BACKGROUND: TMPRSS2-ERG gene fusions occur in about 50% of all prostate cancer cases and represent promising markers for molecular subtyping. Although TMPRSS2-ERG fusion seems to be a critical event in prostate cancer, the precise functional role in cancer development and progression is still unclear. METHODS: We studied large-scale gene expression profiles in 47 prostate tumor tissue samples and in 48 normal prostate tissue samples taken from the non-suspect area of clinical low-risk tumors using Affymetrix GeneChip Exon 1.0 ST microarrays. RESULTS: Comparison of gene expression levels among TMPRSS2-ERG fusion-positive and negative tumors as well as benign samples demonstrated a distinct transcriptional program induced by the gene fusion event. Well-known biomarkers for prostate cancer detection like CRISP3 were found to be associated with the gene fusion status. WNT and TGF-B/BMP signaling pathways were significantly associated with genes upregulated in TMPRSS2-ERG fusion-positive tumors. CONCLUSIONS: The TMPRSS2-ERG gene fusion results in the modulation of transcriptional patterns and cellular pathways with potential consequences for prostate cancer progression. Well-known biomarkers for prostate cancer detection were found to be associated with the gene fusion. Our results suggest that the fusion status should be considered in retrospective and future studies to assess biomarkers for prostate cancer detection, progression and targeted therapy.','2011-12-05',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(7,'Affy_HuEx1ST','GSE41408','23319146','Identification of TDRD1 as a direct target gene of ERG in primary prostate cancer.','Boormans JL, Korsten H, Ziel-van der Made AJ, van Leenders GJ, de Vos CV, Jenster G, Trapman J.','International Journal of Cancer','Molecular classification of ERG-rearranged prostate cancer clarifies the role of TMPRSS2-ERG in the development and progression of prostate cancer. The objective of our study was to identify direct ERG target genes in ERG-rearranged prostate cancer. Two independent cohorts of primary prostate cancer (Cohort A, n=48; Cohort B, n=31), a cohort of late-stage prostate cancer (n=51) and expression array data of a cohort of primary prostate tumors from a different institute (n=128) were analyzed for expression of genes that were coexpressed with ERG overexpression. By genome-wide expression analysis and Q-RT-PCR it was shown that the gene Tudor domain containing 1 (TDRD1) was by far the strongest correlated gene with ERG overexpression in both Cohort A and B. Expression array analysis of the patient cohort from a different institute showed a large overlap in genes that were positively correlated with ERG overexpression, including TDRD1. In late-stage prostate cancer, TDRD1 was also coexpressed with ERG overexpression, although a proportion of ERG-negative late-stage samples expressed TDRD1. TDRD1 expression was not associated with ETV1 overexpression. In the prostate cancer cell line VCaP, downregulation of ERG by shRNA lead to a lower expression level of TDRD1 and resulted in a decreased activity of the TDRD1 promoter. By mutation analysis we identified a functional ERG binding site in the TDRD1 promoter. Our findings show TDRD1 as the first identified upregulated direct ERG target gene that is strongly associated with ERG overexpression in primary prostate cancer.','2013-07-15',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(8,'Affy_HuEx1ST','GSE30521','23083832','A 12-gene expression signature is associated with aggressive histological in prostate cancer: SEC14L1 and TCEB1 genes are potential markers of progression.','Agell L, Hernández S, Nonell L, Lorenzo M, Puigdecanet E, de Muga S, Juanpere N, Bermudo R, Fernández PL, Lorente JA, Serrano S, Lloreta J.','The American Journal of Pathology','The main challenge for clinical management of prostate cancer is to distinguish tumors that will progress faster and will show a higher tendency to recur from the more indolent ones. We have compared expression profiles of 18 prostate cancer samples (seven with a Gleason score of 6, eight with a Gleason score of 7, and three with a Gleason score of >=8) and five nonneoplastic prostate samples, using the Affymetrix Human Array GeneChip Exon 1.0 ST. Microarray analysis revealed 99 genes showing statistically significant differences among tumors with Gleason scores of 6, 7, and >=8. In addition, mRNA expression of 29 selected genes was analyzed by real-time quantitative RT-PCR with microfluidic cards in an extended series of 30 prostate tumors. Of the 29 genes, 18 (62%) were independently confirmed in the extended series by quantitative RT-PCR: 14 were up-regulated and 4 were down-regulated in tumors with a higher Gleason score. Twelve of these genes were differentially expressed in tumors with a Gleason score of 6 to 7 versus >=8. Finally, IHC validation of the protein levels of two genes from the 12-gene signature (SEC14L1 and TCEB1) showed strong protein expression levels of both genes, which were statistically associated with a high combined Gleason score, advanced stage, and prostate-specific antigen progression. This set of genes may contribute to a better understanding of the molecular basis of prostate cancer. TCEB1 and SELC14L1 are good candidate markers for predicting prognosis and progression of prostate cancer.','2012-11-01',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(9,'Affy_U133Plus2','GSE17951','20663908','In silico estimates of tissue components in surgical samples based on expression profiling data.','Wang Y, Xia XQ, Jia Z, Sawyers A, Yao H, Wang-Rodriquez J, Mercola D, McClelland M.','Prostate Cancer and Prostatic Diseases','Tissue samples from many diseases have been used for gene expression profiling studies, but these samples often vary widely in the cell types they contain. Such variation could confound efforts to correlate expression with clinical parameters. In principle, the proportion of each major tissue component can be estimated from the profiling data and used to triage samples before studying correlations with disease parameters. Four large gene expression microarray data sets from prostate cancer, whose tissue components were estimated by pathologists, were used to test the performance of multivariate linear regression models for in silico prediction of major tissue components. Ten-fold cross-validation within each data set yielded average differences between the pathologists\' predictions and the in silico predictions of 8% to 14% for the tumor component and 13% to 17% for the stroma component. Across independent data sets that used similar platforms and fresh frozen samples, the average differences were 11% to 12% for tumor and 12% to 17% for stroma. When the models were applied to 219 arrays of \'tumor-enriched\' samples in the literature, almost one quarter were predicted to have 30% or less tumor cells. Furthermore, there was a 10.5% difference in the average predicted tumor content between 37 recurrent and 42 nonrecurrent cancer patients. As a result, genes that correlated with tissue percentage generally also correlated with recurrence. If such a correlation is not desired, then some samples might be removed to rebalance the data set or tissue percentages might be incorporated into the prediction algorithm. A web service, \'CellPred\', has been designed for the in silico prediction of sample tissue components based on expression data.','2010-08-15',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(10,'Affy_U133Plus2','GSE55945','19737960','Identification of the transcription factor single-minded homologue 2 as a potential biomarker and immunotherapy target in prostate cancer.','Arredouani MS, Lu B, Bhasin M, Eljanne M, Yue W, Mosquera JM, Bubley GJ, Li V, Rubin MA, Libermann TA, Sanda MG.','Clinical Cancer Research','PURPOSE: Identification of novel biomarkers and immunotherapy targets for prostate cancer (PCa) is crucial to better diagnosis and therapy. We sought to identify novel PCa tumor-associated antigens (TAA) that are expressed in PCa, absent in nonprostate human tissue, and immunogenic for immune responses restricted by human HLA. EXPERIMENTAL DESIGN AND RESULTS: Using microarray analysis of normal and cancerous human prostate tissues, we identified 1,063 genes overexpressed in PCa. After validating 195 transcripts in publicly available array data sets, we interrogated expression of these TAAs in normal human tissues to identify genes that are not expressed at detectable levels in normal, nonprostate adult human tissue. We identified 23 PCa TAA candidates. Real-time PCR confirmed that 15 of these genes were overexpressed in PCa (P< 0.05 for each). The most frequently overexpressed gene, single-minded homologue 2 (SIM2), was selected for further evaluation as a potential target for immunotherapy. ELISA assay revealed that a fraction of PCa patients exhibited immune responsiveness to SIM2 as evidenced by the presence of autoantibodies to SIM2 in their sera. We next showed binding of putative HLA-A2.1-restricted SIM2 epitopes to human A2.1, and immunization of transgenic HLA-A2.1 mice showed induction of SIM2-specific CTL responses in vivo. CONCLUSIONS: Our findings that SIM2 is selectively expressed in PCa, that human HLA-A2.1-restricted SIM2 epitopes induce specific T cells in vivo, and that anti-SIM2 antibodies are detectable in PCa patients\' sera implicate SIM2 as a PCa-associated antigen that is a suitable potential target for PCa immunotherapy.','2009-09-15',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(11,'Affy_U133Plus2','GSE3325','16286247','Integrative genomic and proteomic analysis of prostate cancer reveals signatures of metastatic progression.','Varambally S, Yu J, Laxman B, Rhodes DR, Mehra R, Tomlins SA, Shah RB, Chandran U, Monzon FA, Becich MJ, Wei JT, Pienta KJ, Ghosh D, Rubin MA, Chinnaiyan AM.','Cancer Cell','Molecular profiling of cancer at the transcript level has become routine. Large-scale analysis of proteomic alterations during cancer progression has been a more daunting task. Here, we employed high-throughput immunoblotting in order to interrogate tissue extracts derived from prostate cancer. We identified 64 proteins that were altered in prostate cancer relative to benign prostate and 156 additional proteins that were altered in metastatic disease. An integrative analysis of this compendium of proteomic alterations and transcriptomic data was performed, revealing only 48%-64% concordance between protein and transcript levels. Importantly, differential proteomic alterations between metastatic and clinically localized prostate cancer that mapped concordantly to gene transcripts served as predictors of clinical outcome in prostate cancer as well as other solid tumors.','2005-11-08',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(12,'Affy_U133Plus2','GSE45016','19956859','The ubiquitin-like molecule interferon-stimulated gene 15 is overexpressed in human prostate cancer.','Satake H, Tamura K, Furihata M, Anchi T, Sakoda H, Kawada C, Iiyama T, Ashida S, Shuin T.','Oncology Reports','To identify molecules to serve as diagnostic markers for high-grade prostate cancer (PC) and targets for novel therapeutic drugs, we investigated the gene expression profiles of high-grade PCs using a cDNA microarray combined with laser microbeam microdissection. We subsequently confirmed that the ubiquitin-like molecule interferon-stimulated gene 15 (ISG15) was expressed exclusively in high-grade PCs with high Gleason scores. Semi-quantitative reverse transcription PCR and immunohistochemical analysis confirmed the overexpression of ISG15, a 165 amino acid interferon-inducible ubiquitin-like protein, specifically in high-grade PCs with high Gleason scores 8-9, while it was not expressed in the normal prostate. Immunohistochemical analysis using anti-ISG15 polyclonal antibody confirmed an elevated expression of ISG15 protein in high-grade PCs as well as low-grade PCs compared with that in normal prostate (NP) epithelium. Knockdown of ISG15 expression by short interfering RNA (siRNA) in a PC cell line resulted in marked attenuation of PC cell survival; concordantly, ISG15 overexpression in a PC cell line promoted PC cell growth, indicating its oncogenic property. These findings suggest that ISG15 is involved in cell growth and survival of PCs and that it could be a potential molecular target for new therapeutics and a diagnostic biomarker for human PCs.','2010-01-01',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(13,'Affy_U133A','E-TABM-26','16618720','Sex-determining region Y box 4 is a transforming oncogene in human prostate cancer cells.','Liu P, Ramachandran S, Ali Seyed M, Scharer CD, Laycock N, Dalton WB, Williams H, Karanam S, Datta MW, Jaye DL, Moreno CS.','Cancer Research','Prostate cancer is the most commonly diagnosed noncutaneous neoplasm and second most common cause of cancer-related mortality in western men. To investigate the mechanisms of prostate cancer development and progression, we did expression profiling of human prostate cancer and benign tissues. We show that the SOX4 is overexpressed in prostate tumor samples compared with benign tissues by microarray analysis, real-time PCR, and immunohistochemistry. We also show that SOX4 expression is highly correlated with Gleason score at the mRNA and protein level using tissue microarrays. Genes affected by SOX4 expression were also identified, including BCL10, CSF1, and NcoA4/ARA70. TLE-1 and BBC3/PUMA were identified as direct targets of SOX4. Silencing of SOX4 by small interfering RNA transfection induced apoptosis of prostate cancer cells, suggesting that SOX4 could be a therapeutic target for prostate cancer. Stable transfection of SOX4 into nontransformed prostate cells enabled colony formation in soft agar, suggesting that, in the proper cellular context, SOX4 can be a transforming oncogene.','2006-04-15',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(14,'Affy_U133A','GSE8218','21459804','Diagnosis of prostate cancer using differentially expressed genes in stroma.','Jia Z, Wang Y, Sawyers A, Yao H, Rahmatpanah F, Xia XQ, Xu Q, Pio R, Turan T, Koziol JA, Goodison S, Carpenter P, Wang-Rodriguez J, Simoneau A, Meyskens F, Sutton M, Lernhardt W, Beach T, Monforte J, McClelland M, Mercola D.','Cancer Research','More than one million prostate biopsies are performed in the United States every year. A failure to find cancer is not definitive in a significant percentage of patients due to the presence of equivocal structures or continuing clinical suspicion. We have identified gene expression changes in stroma that can detect tumor nearby. We compared gene expression profiles of 13 biopsies containing stroma near tumor and 15 biopsies from volunteers without prostate cancer. About 3,800 significant expression changes were found and thereafter filtered using independent expression profiles to eliminate possible age-related genes and genes expressed at detectable levels in tumor cells. A stroma-specific classifier for nearby tumor was constructed on the basis of 114 candidate genes and tested on 364 independent samples including 243 tumor-bearing samples and 121 nontumor samples (normal biopsies, normal autopsies, remote stroma, as well as stroma within a few millimeters of tumor). The classifier predicted the tumor status of patients using tumor-free samples with an average accuracy of 97% (sensitivity = 98% and specificity = 88%) whereas classifiers trained with sets of 100 randomly generated genes had no diagnostic value. These results indicate that the prostate cancer microenvironment exhibits reproducible changes useful for categorizing the presence of tumor in patients when a prostate sample is derived from near the tumor but does not contain any recognizable tumor.','2011-04-01',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(15,'Affy_U133A','GSE32269','23426182','ERG induces androgen receptor-mediated regulation of SOX9 in prostate cancer.','Cai C, Wang H, He HH, Chen S, He L, Ma F, Mucci L, Wang Q, Fiore C, Sowalsky AG, Loda M, Liu XS, Brown M, Balk SP, Yuan X.','Journal of Clinical Investigation','Fusion of the androgen receptor-regulated (AR-regulated) TMPRSS2 gene with ERG in prostate cancer (PCa) causes androgen-stimulated overexpression of ERG, an ETS transcription factor, but critical downstream effectors of ERG-mediating PCa development remain to be established. Expression of the SOX9 transcription factor correlated with TMPRSS2:ERG fusion in 3 independent PCa cohorts, and ERG-dependent expression of SOX9 was confirmed by RNAi in the fusion-positive VCaP cell line. SOX9 has been shown to mediate ductal morphogenesis in fetal prostate and maintain stem/progenitor cell pools in multiple adult tissues, and has also been linked to PCa and other cancers. SOX9 overexpression resulted in neoplasia in murine prostate and stimulated tumor invasion, similarly to ERG. Moreover, SOX9 depletion in VCaP cells markedly impaired invasion and growth in vitro and in vivo, establishing SOX9 as a critical downstream effector of ERG. Finally, we found that ERG regulated SOX9 indirectly by opening a cryptic AR-regulated enhancer in the SOX9 gene. Together, these results demonstrate that ERG redirects AR to a set of genes including SOX9 that are not normally androgen stimulated, and identify SOX9 as a critical downstream effector of ERG in TMPRSS2:ERG fusion-positive PCa.','2013-03-01',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(16,'Affy_U95Av2','BI-GDAC','12086878','Gene expression correlates of clinical prostate cancer behavior.','Singh D, Febbo PG, Ross K, Jackson DG, Manola J, Ladd C, Tamayo P, Renshaw AA, D\'Amico AV, Richie JP, Lander ES, Loda M, Kantoff PW, Golub TR, Sellers WR.','Cancer Cell','Prostate tumors are among the most heterogeneous of cancers, both histologically and clinically. Microarray expression analysis was used to determine whether global biological differences underlie common pathological features of prostate cancer and to identify genes that might anticipate the clinical behavior of this disease. While no expression correlates of age, serum prostate specific antigen (PSA), and measures of local invasion were found, a set of genes was identified that strongly correlated with the state of tumor differentiation as measured by Gleason score. Moreover, a model using gene expression data alone accurately predicted patient outcome following prostatectomy. These results support the notion that the clinical behavior of prostate cancer is linked to underlying gene expression differences that are detectable at the time of diagnosis.','2002-03-01',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(17,'Affy_U95Av2','GSE1431','14722351','In silico dissection of cell-type-associated patterns of gene expression in prostate cancer.','Stuart RO, Wachsman W, Berry CC, Wang-Rodriguez J, Wasserman L, Klacansky I, Masys D, Arden K, Goodison S, McClelland M, Wang Y, Sawyers A, Kalcheva I, Tarin D, Mercola D.','Proceedings of the National Academy of Sciences','Prostate tumors are complex entities composed of malignant cells mixed and interacting with nonmalignant cells. However, molecular analyses by standard gene expression profiling are limited because spatial information and nontumor cell types are lost in sample preparation. We scored 88 prostate specimens for relative content of tumor, benign hyperplastic epithelium, stroma, and dilated cystic glands. The proportions of these cell types were then linked in silico to gene expression levels determined by microarray analysis, revealing unique cell-specific profiles. Gene expression differences for malignant and nonmalignant epithelial cells (tumor versus benign hyperplastic epithelium) could be identified without being confounded by contributions from stroma that dominate many samples or sacrificing possible paracrine influences. Cell-specific expression of selected genes was validated by immunohistochemistry and quantitative PCR. The results provide patterns of gene expression for these three lineages with relevance to pathogenetic, diagnostic, and therapeutic considerations.','2004-01-13',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks'),(18,'Illum_HT_12v3','GSE32571','22945237','The maternal embryonic leucine zipper kinase (MELK) is upregulated in high-grade prostate cancer.','Kuner R, Fälth M, Pressinotti NC, Brase JC, Puig SB, Metzger J, Gade S, Schäfer G, Bartsch G, Steiner E, Klocker H, Sültmann H.','Journal of Molecular Medicine','Loss of cell cycle control is a prerequisite for cancer onset and progression. In prostate cancer, increased activity of cell cycle genes has been associated with prognostic parameters such as biochemical relapse and survival. The identification of novel oncogenic and druggable targets in patient subgroups with poor prognosis may help to develop targeted therapy approaches. We analyzed prostate cancer and corresponding benign tissues (n = 98) using microarrays. The comparison of high- and low-grade tumors (Gleason score >= 4 + 3 vs. <= 3 + 4) revealed 144 differentially expressed genes (p < 0.05). Out of these, 15 genes were involved in the cell cycle process. The gene maternal embryonic leucine zipper kinase (MELK) was identified to be highly correlated with cell cycle genes like UBE2C, TOP2A, CCNB2, and AURKB. Increased MELK gene expression in high-risk prostate cancer was validated by qPCR in an independent patient cohort (p < 0.005, n = 79). Immunohistochemistry analysis using a tissue microarray (n = 94) revealed increased MELK protein expression in prostate cancer tissues of high Gleason scores. RNAi-based inhibition of MELK in PC3 and LNCaP cells suggested putative function in chromatin modification, embryonic development and cell migration. The concerted inhibition of MELK and other cell cycle targets by the antibiotic siomycin A strongly impaired cell viability of prostate cancer cells, and may point to a novel therapy approach for a subset of high-risk prostate cancer patients.','2013-02-01',0,'PCA,Tumour purity,Expression heatmap,Expression profiles,Expression correlations,Gene networks');
